感情生活<br />
2016年Sue與香港富二代男朋友Johm Cheung訂婚。 在求婚當日，Sue男朋友叫她和一位女姓朋友（Raven Luk，也是位Youtuber）到南山公園，她以為只是行山活動。直到她看到她的家人和香港好友們在場，才知道她男朋友正準備向她求婚。最終，阿Sue答應與她男朋友結婚。<br />
杨受成二公子游艇开船P 众女星上船钓金龟 2012 年的sue和女友人活躍富二代狂野船party上船陪玩（包括倪晨曦和韩妹蔡恩真）, 她以本地韓妹突圍而出成功混入abc港姐和奀星群裡，由於當時活躍於各富二代船派對, 成功認識黏上了不少富二代公子和現任老公。&rdquo;

